    return (
        <div className="App mt-3">
               <table className="table"  striped bordered>
                    <thead>
                        <tr>
                            <th scope="col">Diameter</th>
                            <th scope="col">Slices</th>
                            <th scope="col">Toppings</th>
                            <th scope="col">Price</th>
                        </tr>
                    </thead>
                    <tbody>
                        {props.pizza()}
                    </tbody>
                </table>
        </div>
    );
}

export default table
